import React from 'react'
import foodImages from './FoodImages'
import './images.css'

export default function MainPage() {
  return (
    <div style={{ margin: "50px" }} className='shadow-lg p-3 mb-4 bg-white rounded'>
      <div className='image-container'>
        {foodImages.slice(0, 2).map((foodImage, index) => (
          <div key={index} className='food-image'>
           {foodImages.image}
            <h1>{foodImage.type}</h1>
          </div>
        ))}
      </div>
    </div>
  )
}
